import React, { Component } from "react";
import { NavLink } from "react-router-dom";

export default class Logo extends Component {
	constructor (props) {
		super(props)
		this.state = {
			name: 'Qtemu',			
		};
	}

	render (){
		return(
			<Menu menus = {this.state.name}/>
		)
		
		
	}
}
